import React from 'react';

function MessageList(props) {
  const messages = props.messages;
  const listItems = messages.map((message) =>
    <ListItem key={message.toString()}
              value={text} />
  );
  return (
    <ul>
      {listItems}
    </ul>
  );
}

export default MessageList;
